import React, { useState }from 'react';
import { TodoListItem }from './TodoListItem'

const todos: Todo[] = [{text: 'Lifts head when on his tummy',isCompleted: false},
                       {text: 'e99e9e',isCompleted: false},
];

const App: React.FC = () => {
const [inputValue, setInputValue] = useState('0');

  return <>
   <div>
     How many months is your baby?
     <input type='number' min='0' value={inputValue}
     onChange={(e: React.ChangeEvent<HTMLInputElement>)=> {setInputValue(e.target.value)}}
     />
     </div>
     {inputValue > 0 && <TodoListItem todo={todos} /> }
  </>
}

export default App;
